import React from 'react';

function Messages({ messages }) {
  return (
    <div className="row messages-row">
      <div className="col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6">
        {messages.map((item) => {
          return (
            <>
              <div className="row">
                <span>{item.title}</span>
              </div>
              <div className="row">
                <span>{item.body}</span>
              </div>
            </>
          );
        })}
      </div>
    </div>
  );
}

export default Messages;
